import React from "react";
import Carasoule from "./Carasoule";

const Home=()=>{
    return(
        <>
            <Carasoule/>

            <div className="container mt-5 jumbotron text-center">
                <div className="row mt-5">
                    <div className="col-12">
                        <h2>Our Services</h2>
                    </div>
                </div>
            </div>
            <hr style={{width:'20%'}}/>
        </>
    );
}

export default Home;
